    false,nt"url": null,nt"notes": "Report of burrowing owl nesting activity
    in the Central Region of Colorado in 1994, produced by the Colorado Division of
    Wildlife. There is little long term data on burrowing owl population trends in Colorado.
    The U.S. Fish and Wildlife Service (USFWS) Breeding Bird survey data suggest a decline
    from 1966 to 1989 in the Colorado burrowing owl population and an increase from
    1980 to 1989. However, both of these trends are not statistically significant and
    the validity of this data for long term trend analysis has been questioned (Barker
    1991). While population declines over large areas have not been confirmed in Colorado,
    local population declines and potential causes have been identified. Loss of breeding
    habitat through control of prairie dogs, cultivation of grasslands and urbanization
    are suspected of causing population declines. In addition, pesticides may cause
    declines by reducing insect prey species, direct mortality of the birds, or reduced
    reproductive success. This study contains information about burrowing owl populations
    nested at the Denver International Airport (DIA) mitigation site and on the Rocky
    Mountain Arsenal National Wildlife Refuge. The purpose of this survey was to inventory
    breeding burrowing owl populations in the Central Region.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
